import Foundation
import XCTest

@testable import SystemStrings

// MARK: - FileProvider Tests

@available(iOS 11, *)
final class FileProviderStringsTests: XCTestCase {

    override func tearDown() {
        super.tearDown()
        Util｜FileProvider.preferredLocalization = nil
    }

    func test_default() {
        Util｜FileProvider.preferredLocalization = nil
        XCTAssertEqual(String.（Copy）｜FileProvider, "\u{54}\u{68}\u{65}\u{20}\u{43}\u{6F}\u{70}\u{79}\u{20}\u{4F}\u{70}\u{65}\u{72}\u{61}\u{74}\u{69}\u{6F}\u{6E}\u{20}\u{43}\u{61}\u{6E}\u{2019}\u{74}\u{20}\u{42}\u{65}\u{20}\u{43}\u{6F}\u{6D}\u{70}\u{6C}\u{65}\u{74}\u{65}\u{64}")
        XCTAssertEqual(String.（Move）｜FileProvider, "\u{54}\u{68}\u{65}\u{20}\u{4D}\u{6F}\u{76}\u{65}\u{20}\u{4F}\u{70}\u{65}\u{72}\u{61}\u{74}\u{69}\u{6F}\u{6E}\u{20}\u{43}\u{61}\u{6E}\u{2019}\u{74}\u{20}\u{42}\u{65}\u{20}\u{43}\u{6F}\u{6D}\u{70}\u{6C}\u{65}\u{74}\u{65}\u{64}")
        XCTAssertEqual(String.（Open）｜FileProvider, "\u{43}\u{61}\u{6E}\u{2019}\u{74}\u{20}\u{4F}\u{70}\u{65}\u{6E}\u{20}\u{46}\u{69}\u{6C}\u{65}")
        XCTAssertEqual(String.（Remove）｜FileProvider, "\u{54}\u{68}\u{65}\u{20}\u{44}\u{65}\u{6C}\u{65}\u{74}\u{65}\u{20}\u{4F}\u{70}\u{65}\u{72}\u{61}\u{74}\u{69}\u{6F}\u{6E}\u{20}\u{43}\u{61}\u{6E}\u{2019}\u{74}\u{20}\u{42}\u{65}\u{20}\u{43}\u{6F}\u{6D}\u{70}\u{6C}\u{65}\u{74}\u{65}\u{64}")
        XCTAssertEqual(String.（Rename）｜FileProvider, "\u{54}\u{68}\u{65}\u{20}\u{52}\u{65}\u{6E}\u{61}\u{6D}\u{65}\u{20}\u{4F}\u{70}\u{65}\u{72}\u{61}\u{74}\u{69}\u{6F}\u{6E}\u{20}\u{43}\u{61}\u{6E}\u{2019}\u{74}\u{20}\u{42}\u{65}\u{20}\u{43}\u{6F}\u{6D}\u{70}\u{6C}\u{65}\u{74}\u{65}\u{64}")
        XCTAssertEqual(String.．f（Copy）｜FileProvider, "\u{43}\u{61}\u{6E}\u{2019}\u{74}\u{20}\u{43}\u{6F}\u{70}\u{79}\u{20}\u{201C}\u{25}\u{40}\u{201D}")
        XCTAssertEqual(String.．f（Move）｜FileProvider, "\u{43}\u{61}\u{6E}\u{2019}\u{74}\u{20}\u{4D}\u{6F}\u{76}\u{65}\u{20}\u{201C}\u{25}\u{40}\u{201D}")
        XCTAssertEqual(String.．f（Remove）｜FileProvider, "\u{43}\u{61}\u{6E}\u{2019}\u{74}\u{20}\u{44}\u{65}\u{6C}\u{65}\u{74}\u{65}\u{20}\u{201C}\u{25}\u{40}\u{201D}")
        XCTAssertEqual(String.．f（Rename）｜FileProvider, "\u{43}\u{61}\u{6E}\u{2019}\u{74}\u{20}\u{52}\u{65}\u{6E}\u{61}\u{6D}\u{65}\u{20}\u{201C}\u{25}\u{40}\u{201D}")
        XCTAssertEqual(String.ACTION_CREATE_DIR｜FileProvider, "\u{4E}\u{65}\u{77}\u{20}\u{44}\u{69}\u{72}\u{65}\u{63}\u{74}\u{6F}\u{72}\u{79}")
        XCTAssertEqual(String.ACTION_DELETE｜FileProvider, "\u{44}\u{65}\u{6C}\u{65}\u{74}\u{65}")
        XCTAssertEqual(String.ACTION_EVICT｜FileProvider, "\u{45}\u{76}\u{69}\u{63}\u{74}")
        XCTAssertEqual(String.ACTION_RENAME｜FileProvider, "\u{52}\u{65}\u{6E}\u{61}\u{6D}\u{65}")
        XCTAssertEqual(String.ACTION_SHARE｜FileProvider, "\u{53}\u{68}\u{61}\u{72}\u{65}")
        XCTAssertEqual(String.ARCHIVE_ENTER_DECRYPTION_PASSWORD｜FileProvider, "\u{50}\u{6C}\u{65}\u{61}\u{73}\u{65}\u{20}\u{65}\u{6E}\u{74}\u{65}\u{72}\u{20}\u{74}\u{68}\u{65}\u{20}\u{70}\u{61}\u{73}\u{73}\u{77}\u{6F}\u{72}\u{64}\u{20}\u{66}\u{6F}\u{72}\u{20}\u{201C}\u{25}\u{40}\u{201D}\u{2E}")
        XCTAssertEqual(String.ARCHIVE_FILENAME｜FileProvider, "\u{41}\u{72}\u{63}\u{68}\u{69}\u{76}\u{65}")
        XCTAssertEqual(String.CANCEL_POSIX_DOWNLOAD_BODY｜FileProvider, "\u{54}\u{68}\u{65}\u{20}\u{66}\u{69}\u{6C}\u{65}\u{20}\u{77}\u{6F}\u{6E}\u{2019}\u{74}\u{20}\u{6F}\u{70}\u{65}\u{6E}\u{20}\u{75}\u{6E}\u{74}\u{69}\u{6C}\u{20}\u{74}\u{68}\u{65}\u{20}\u{64}\u{6F}\u{77}\u{6E}\u{6C}\u{6F}\u{61}\u{64}\u{20}\u{63}\u{6F}\u{6D}\u{70}\u{6C}\u{65}\u{74}\u{65}\u{73}\u{2E}")
        XCTAssertEqual(String.CANCEL_POSIX_DOWNLOAD_CANCEL_BUTTON｜FileProvider, "\u{43}\u{61}\u{6E}\u{63}\u{65}\u{6C}")
        XCTAssertEqual(String.CANCEL_POSIX_DOWNLOAD_TITLE_app_domain｜FileProvider, "\u{25}\u{40}\u{20}\u{69}\u{73}\u{20}\u{64}\u{6F}\u{77}\u{6E}\u{6C}\u{6F}\u{61}\u{64}\u{69}\u{6E}\u{67}\u{20}\u{61}\u{20}\u{66}\u{69}\u{6C}\u{65}\u{20}\u{66}\u{72}\u{6F}\u{6D}\u{20}\u{25}\u{40}")
        XCTAssertEqual(String.CANCEL_POSIX_DOWNLOAD_WAIT_BUTTON｜FileProvider, "\u{43}\u{6F}\u{6E}\u{74}\u{69}\u{6E}\u{75}\u{65}\u{20}\u{57}\u{61}\u{69}\u{74}\u{69}\u{6E}\u{67}")
        XCTAssertEqual(String.ClientLacksEntitlement｜FileProvider, "\u{54}\u{68}\u{65}\u{20}\u{63}\u{61}\u{6C}\u{6C}\u{65}\u{72}\u{20}\u{69}\u{73}\u{20}\u{6E}\u{6F}\u{74}\u{20}\u{61}\u{6C}\u{6C}\u{6F}\u{77}\u{65}\u{64}\u{20}\u{74}\u{6F}\u{20}\u{70}\u{65}\u{72}\u{66}\u{6F}\u{72}\u{6D}\u{20}\u{61}\u{6E}\u{20}\u{6F}\u{70}\u{65}\u{72}\u{61}\u{74}\u{69}\u{6F}\u{6E}\u{2E}")
        XCTAssertEqual(String.Copy﹣Keep_Both｜FileProvider, "\u{4B}\u{65}\u{65}\u{70}\u{20}\u{42}\u{6F}\u{74}\u{68}")
        XCTAssertEqual(String.Copy﹣Replace｜FileProvider, "\u{52}\u{65}\u{70}\u{6C}\u{61}\u{63}\u{65}")
        XCTAssertEqual(String.Copy﹣Stop｜FileProvider, "\u{53}\u{74}\u{6F}\u{70}")
        XCTAssertEqual(String.DOMAIN_ARCHIVE_FILENAME｜FileProvider, "\u{25}\u{40}\u{20}\u{28}\u{41}\u{72}\u{63}\u{68}\u{69}\u{76}\u{65}\u{29}")
        XCTAssertEqual(String.Disconnect﹣Cancel｜FileProvider, "\u{43}\u{61}\u{6E}\u{63}\u{65}\u{6C}")
        XCTAssertEqual(String.Disconnect﹣Force｜FileProvider, "\u{46}\u{6F}\u{72}\u{63}\u{65}\u{20}\u{44}\u{69}\u{73}\u{63}\u{6F}\u{6E}\u{6E}\u{65}\u{63}\u{74}")
        XCTAssertEqual(String.Downloads｜FileProvider, "\u{44}\u{6F}\u{77}\u{6E}\u{6C}\u{6F}\u{61}\u{64}\u{73}")
        XCTAssertEqual(String.InvalidBookmark｜FileProvider, "\u{54}\u{68}\u{65}\u{20}\u{62}\u{6F}\u{6F}\u{6B}\u{6D}\u{61}\u{72}\u{6B}\u{20}\u{69}\u{73}\u{20}\u{69}\u{6E}\u{76}\u{61}\u{6C}\u{69}\u{64}\u{2E}")
        XCTAssertEqual(String.InvalidParameter_Parameter｜FileProvider, "\u{54}\u{68}\u{65}\u{20}\u{70}\u{61}\u{72}\u{61}\u{6D}\u{65}\u{74}\u{65}\u{72}\u{20}\u{201C}\u{25}\u{40}\u{201D}\u{20}\u{69}\u{73}\u{20}\u{69}\u{6E}\u{76}\u{61}\u{6C}\u{69}\u{64}\u{2E}")
        XCTAssertEqual(String.InvalidParameter_Parameter_Value｜FileProvider, "\u{54}\u{68}\u{65}\u{20}\u{76}\u{61}\u{6C}\u{75}\u{65}\u{20}\u{201C}\u{25}\u{40}\u{201D}\u{20}\u{69}\u{73}\u{20}\u{6E}\u{6F}\u{74}\u{20}\u{76}\u{61}\u{6C}\u{69}\u{64}\u{20}\u{66}\u{6F}\u{72}\u{20}\u{74}\u{68}\u{65}\u{20}\u{70}\u{61}\u{72}\u{61}\u{6D}\u{65}\u{74}\u{65}\u{72}\u{20}\u{201C}\u{25}\u{40}\u{201D}\u{2E}")
        XCTAssertEqual(String.InvalidURL｜FileProvider, "\u{54}\u{68}\u{65}\u{20}\u{55}\u{52}\u{4C}\u{20}\u{69}\u{73}\u{20}\u{69}\u{6E}\u{76}\u{61}\u{6C}\u{69}\u{64}\u{2E}")
        XCTAssertEqual(String.ItemExists｜FileProvider, "\u{54}\u{68}\u{65}\u{20}\u{66}\u{69}\u{6C}\u{65}\u{20}\u{61}\u{6C}\u{72}\u{65}\u{61}\u{64}\u{79}\u{20}\u{65}\u{78}\u{69}\u{73}\u{74}\u{73}\u{20}\u{69}\u{6E}\u{20}\u{74}\u{68}\u{69}\u{73}\u{20}\u{6C}\u{6F}\u{63}\u{61}\u{74}\u{69}\u{6F}\u{6E}\u{2E}")
        XCTAssertEqual(String.ItemExists﹣C（﹡）｜FileProvider, "\u{54}\u{68}\u{65}\u{20}\u{66}\u{69}\u{6C}\u{65}\u{20}\u{61}\u{6C}\u{72}\u{65}\u{61}\u{64}\u{79}\u{20}\u{65}\u{78}\u{69}\u{73}\u{74}\u{73}\u{20}\u{69}\u{6E}\u{20}\u{74}\u{68}\u{69}\u{73}\u{20}\u{6C}\u{6F}\u{63}\u{61}\u{74}\u{69}\u{6F}\u{6E}\u{2E}")
        XCTAssertEqual(String.ItemExists﹣C．f（﹡）｜FileProvider, "\u{54}\u{68}\u{65}\u{20}\u{66}\u{69}\u{6C}\u{65}\u{20}\u{201C}\u{25}\u{40}\u{201D}\u{20}\u{61}\u{6C}\u{72}\u{65}\u{61}\u{64}\u{79}\u{20}\u{65}\u{78}\u{69}\u{73}\u{74}\u{73}\u{20}\u{69}\u{6E}\u{20}\u{74}\u{68}\u{69}\u{73}\u{20}\u{6C}\u{6F}\u{63}\u{61}\u{74}\u{69}\u{6F}\u{6E}\u{2E}")
        XCTAssertEqual(String.ItemExists﹣R（﹡）｜FileProvider, "\u{44}\u{6F}\u{20}\u{79}\u{6F}\u{75}\u{20}\u{77}\u{61}\u{6E}\u{74}\u{20}\u{74}\u{6F}\u{20}\u{72}\u{65}\u{70}\u{6C}\u{61}\u{63}\u{65}\u{20}\u{69}\u{74}\u{3F}")
        XCTAssertEqual(String.ItemExists﹣R（Copy）｜FileProvider, "\u{54}\u{68}\u{65}\u{20}\u{66}\u{69}\u{6C}\u{65}\u{20}\u{61}\u{6C}\u{72}\u{65}\u{61}\u{64}\u{79}\u{20}\u{65}\u{78}\u{69}\u{73}\u{74}\u{73}\u{20}\u{69}\u{6E}\u{20}\u{74}\u{68}\u{69}\u{73}\u{20}\u{6C}\u{6F}\u{63}\u{61}\u{74}\u{69}\u{6F}\u{6E}\u{2E}\u{20}\u{44}\u{6F}\u{20}\u{79}\u{6F}\u{75}\u{20}\u{77}\u{61}\u{6E}\u{74}\u{20}\u{74}\u{6F}\u{20}\u{72}\u{65}\u{70}\u{6C}\u{61}\u{63}\u{65}\u{20}\u{69}\u{74}\u{20}\u{77}\u{69}\u{74}\u{68}\u{20}\u{74}\u{68}\u{65}\u{20}\u{6F}\u{6E}\u{65}\u{20}\u{79}\u{6F}\u{75}\u{2019}\u{72}\u{65}\u{20}\u{63}\u{6F}\u{70}\u{79}\u{69}\u{6E}\u{67}\u{3F}")
        XCTAssertEqual(String.ItemExists﹣R（Move）｜FileProvider, "\u{54}\u{68}\u{65}\u{20}\u{66}\u{69}\u{6C}\u{65}\u{20}\u{61}\u{6C}\u{72}\u{65}\u{61}\u{64}\u{79}\u{20}\u{65}\u{78}\u{69}\u{73}\u{74}\u{73}\u{20}\u{69}\u{6E}\u{20}\u{74}\u{68}\u{69}\u{73}\u{20}\u{6C}\u{6F}\u{63}\u{61}\u{74}\u{69}\u{6F}\u{6E}\u{2E}\u{20}\u{44}\u{6F}\u{20}\u{79}\u{6F}\u{75}\u{20}\u{77}\u{61}\u{6E}\u{74}\u{20}\u{74}\u{6F}\u{20}\u{72}\u{65}\u{70}\u{6C}\u{61}\u{63}\u{65}\u{20}\u{69}\u{74}\u{20}\u{77}\u{69}\u{74}\u{68}\u{20}\u{74}\u{68}\u{65}\u{20}\u{6F}\u{6E}\u{65}\u{20}\u{79}\u{6F}\u{75}\u{2019}\u{72}\u{65}\u{20}\u{6D}\u{6F}\u{76}\u{69}\u{6E}\u{67}\u{3F}")
