        XCTAssertEqual(String.NewerItemExists﹣C．f（﹡）｜FileProvider, "\u{41}\u{20}\u{6E}\u{65}\u{77}\u{65}\u{72}\u{20}\u{69}\u{74}\u{65}\u{6D}\u{20}\u{6E}\u{61}\u{6D}\u{65}\u{64}\u{20}\u{201C}\u{25}\u{40}\u{201D}\u{20}\u{61}\u{6C}\u{72}\u{65}\u{61}\u{64}\u{79}\u{20}\u{65}\u{78}\u{69}\u{73}\u{74}\u{73}\u{20}\u{69}\u{6E}\u{20}\u{74}\u{68}\u{69}\u{73}\u{20}\u{6C}\u{6F}\u{63}\u{61}\u{74}\u{69}\u{6F}\u{6E}\u{2E}")
